func TestIntersection(t *testing.T) {
	testCases := []struct {
		name     string
		n        [2][]int
		expected []int
	}{
		{
			"basic case. nil slice",
			[2][]int{nil, nil},
			[]int{},
		},
		{
			"basic case. empty slice",
			[2][]int{[]int{}, []int{}},
			[]int{},
		},
		{
			"basic case. single element slice",
			[2][]int{[]int{0}, []int{}},
			[]int{},
		},
		{
			"basic case. single element slice for the second slice",
			[2][]int{[]int{}, []int{0}},
			[]int{},
		},
		{
			"single common element",
			[2][]int{[]int{0, 1, 2, 3, 4, 4}, []int{4}},
			[]int{4},
		},
		{
			"negative integers",
			[2][]int{[]int{0, -1, -2, -3, -4, -4}, []int{-4, 0}},
			[]int{0, -4},
		},
		{
			"opposite integers",
			[2][]int{{0, 1, 2, 3, 4, 4, 0, -1, -2, -3, -4, -4}, {-1, 6, 7, 10, 2}},
			[]int{-1, 2},
		},
	}

	for _, tc := range testCases {
		tc := tc
		t.Run(tc.name, func(t *testing.T) {
			t.Parallel()

			res := map3(tc.n[0], tc.n[1])

			sort.Ints(res)
			sort.Ints(tc.expected)

			if !reflect.DeepEqual(res, tc.expected) {
				t.Fatalf("got\t\t%v\nwant\t%v", res, tc.expected)
			}
		})
	}
}

func TestFibonacci(t *testing.T) {
	testCases := []struct {
		name        string
		n           uint64
		expected    uint64
		expectedErr error
	}{
		{
			"basic case 0",
			0,
			0,
			nil,
		},
		{
			"basic case 1",
			1,
			1,
			nil,
		},
		{
			"basic case 2",
			2,
			1,
			nil,
		},
		{
			"case 2",
			5,
			5,
			nil,
		},
		{
			"case 10",
			10,
			55,
			nil,
		},
		{
			"case 10000 - overflow",
			10000,
			0,
			ErrOverflow,
		},
	}

	for _, tc := range testCases {
		tc := tc
		t.Run(tc.name, func(t *testing.T) {
			t.Parallel()

			f := map4()
			res := f(int(tc.n))
			var err error
			if tc.expectedErr != nil && !errors.Is(err, tc.expectedErr) {
				t.Fatalf("For case %d\nan error got\t\t'%v'(result - %d)\nwant\t'%v'", tc.n, err, res, tc.expectedErr)
			}
			if res != int(tc.expected) {
				t.Fatalf("For case %d\ngot\t\t%v\nwant\t%v", tc.n, res, tc.expected)
			}
		})
	}
}
